import { Link } from 'react-router-dom';

function Home() {
  return (
    <>
      <section className="heading">
        <h1>How can we help you</h1>
        <p>Choose option</p>
      </section>
      <Link to="/new-ticket" className="btn btn-reverse btn-block"></Link>
    </>
  );
}

export default Home;
